import React from "react";

import UsersList from "../components/UsersList";

const Users = () => {
    const USERS = [
        {
            id : 'u1', 
            name : 'Ananya Gupta', 
            image : 'https://media.istockphoto.com/id/1381637603/photo/mountain-landscape.jpg?s=2048x2048&w=is&k=20&c=KIQfpt1GjnhLhDPF0-hj8vfjKRFlA8YGMx5XZk09Fjo=',
            places : 3
        }
    ];
    return <UsersList items = {USERS} />;
};

export default Users;
